import React from 'react';
import Formulario from './components/Formulario';  // Importe o componente Formulario
import './App.css';

function App() {
  const handleSubmit = (dadosFormulario) => {
    // Aqui você pode adicionar a lógica para enviar os dados para o backend
    console.log('Dados do formulário enviados:', dadosFormulario);
  };

  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <Formulario onSubmit={handleSubmit} />  {/* Renderize o componente Formulario */}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
